import React from 'react'

const Notification = ({ success_message, error_message }) => {
    console.log(success_message)
    if (success_message === null) {
        return null
    }

    return (
        <div >
            <div className="success">
                {success_message}

            </div>
            <div className="error">
                {error_message}

            </div>
        </div>
    )
}
export default Notification
